import ChartBar from "./ChartBar";
import React from "./react";

const Chart = (props) => {
  return (
    <div className="chart">
      {props.datePoints.map((dataPoint) => (
        <ChartBar key={dataPoint.id} />
      ))}
    </div>
  );
};

export default Chart;
